import React from 'react'

import {Footer, Blog, Possibility, Features, WhatGPT3, Header } from './containers';
import {CTA, Brand, Navbar} from './components';



const App = () => {
  return (
    <div class='App'>
      <div class='gradient__bg'>
        <Navbar />
        <Header />
      </div>
      <Brand />
      <WhatGPT3 />
      <Features />
      <Possibility />
    </div>
  )
}

export default App
